import React from "react";
import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap/dist/js/bootstrap'
import './App.css'

import NAVBAR from "./Components/NAVBAR/NAVBAR";
function App() {
  return (
    <div className="App">
      <div class="parallax-container">
    <div className="parallax-layer layer1"></div>
    <div className="parallax-layer layer2"></div>
    <div className="parallax-layer layer3"></div>
    <div className="parallax-content">
      <h1>Welcome to the Parallax Effect</h1>
      <p>This is a simple example of a parallax scrolling effect using HTML and CSS.</p>
    </div>
  </div>
    </div>
  );
}

export default App;
